import { Container, Col, Row } from 'reactstrap';
import Signup from '../home/Signup';

const Auth = (props) => {
    return ( 
        <Container className="auth-container">
            <Row>
                <Col md="6">
                    <Signup/>
                </Col>
                <Col md="6" className="login-col">
                    Login
                </Col>
            </Row>
        </Container>
     );
}

export default Auth;
